import React, { useState } from "react";
import { api_url } from "../src/config/Config";
import _fetch from "./config/api";
import toasted from "./config/toast";

export default function Register() {

    const { allFields, setAllFields } = useState({
        name: "",
        email: "",
        phone: "",
        password: ""
    });

    const handleChange = (event) => {
        setAllFields({
            ...allFields,
            [event.target.name]: event.target.value
        })
    }

    const SubmitRegister = async () => {
        let response = await _fetch(`${api_url}auth/register`, "POST", allFields, {});
        console.log(response);
        if (response?.status == 'success') {
            toasted.success(response?.message);
        }
        else {
            toasted.error(response?.message);
        }
    }

    return (
        <>
  <div className="form-container">
      <div className="form-wrapper">
        <h2 className="form-title">Register</h2>

        <div className="input-group">
          <label htmlFor="name">Name</label>
          <input 
            id="name" 
            type="text" 
            value={allFields?.name} 
            onChange={handleChange} 
          />
        </div>

        <div className="input-group">
          <label htmlFor="email">Email</label>
          <input 
            id="email" 
            type="text" 
            value={allFields?.email} 
            onChange={handleChange} 
          />
        </div>

        <div className="input-group">
          <label htmlFor="phone">Phone</label>
          <input 
            id="phone" 
            type="text" 
            value={allFields?.phone} 
            onChange={handleChange} 
          />
        </div>

        <div className="input-group">
          <label htmlFor="password">Password</label>
          <input 
            id="password" 
            type="text" 
            value={allFields?.password} 
            onChange={handleChange} 
          />
        </div>

        <div className="form-footer">
          <button className="submit-btn" onClick={SubmitRegister}>
            Register
          </button>
        </div>
      </div>
    </div>
        </>
    )
}
